import React from 'react'
import styles from "./Navbar.module.css"
export const Navbar = () => {
  return (
    <div className={styles.container}>
        <p className={styles.logo}>Learn DSA</p>
        <div className={styles.tabs}>
            <a>Features</a>
        </div>
    </div>
  )
}
